    [],nt"revision_timestamp": "2016-07-27T22:42:18.055289",nt"name": "proposed-new-madrid-nwr-contaminant-survey",nt"isopen":
    false,nt"url": null,nt"notes": "The area studied in this report is near
    New Madrid in southeast Missouri. This area consists of the St. John's Bayou, 8,500
    acres and Eagle's Nest area, 3,500 acres. These adjoining areas comprise (at the
    time this study was initiated) the proposed Fish and Wildlife Service (FWS) acquisition
    for a new National Wildlife Refuge. A site visit was conducted in May of 1988 by
    the CMFO contaminant biologist. Several illegal dumps were located in just one cursory
    survey. These unauthorized waste disposal sites could be a source of contamination
    to the study area. Man applied chemicals are a potential threat to fish and wildlife
    in the study area. As a result, fish and sediment samples were analyzed to determine
    contaminant levels in the area.",nt"license_title": "License Not Specified",nt"extras":
